import classes from './NewsSection.module.css';

const NewsSection = () => {
  return(
    <section className={classes.News}>
    <div className="Container">
      <h2 className={classes.NewsHeader}>Новости</h2>
      .
    </div>
    </section>
  )
}

export default NewsSection;
